import React, { useState } from 'react';
import axios from 'axios';
import './ItemForm.css'; // Import the CSS file

const ItemForm = ({ onItemCreated }) => {
  const [formData, setFormData] = useState({
    actualPrice: '',
    comment: '',
    eventVenuesID: '',
    imageUrl: '',
    listingPrice: '',
    ordersID: '',
    sellerID: '',
    sellingPrice: '',
    status: '',
    type: '',
    validatedOn: '',
    verified: true,
    lock: true
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:5000/cart/tickets', formData)
      .then(response => {
        alert('Item created successfully');
        onItemCreated(); // Fetch updated item list
        console.log(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div className="form-container">
      <div className="form-wrapper">
        <h2>Create a new item</h2>
        <form onSubmit={handleSubmit}>
        <div class="form-container">
        <div class="form-wrapper">
            <h2>Create a New Item</h2>
            <form onsubmit="handleSubmit(event)">
                <div class="form-group-inline">
                    <label for="actualPrice">Actual Price:</label>
                    <input type="number" id="actualPrice" name="actualPrice" value="" onchange="handleChange(event)" required />
                    
                    <label for="listingPrice">Listing Price:</label>
                    <input type="number" id="listingPrice" name="listingPrice" value="" onchange="handleChange(event)" required />
                </div>
                <div class="form-group-inline">
                    <label for="sellingPrice">Selling Price:</label>
                    <input type="number" id="sellingPrice" name="sellingPrice" value="" onchange="handleChange(event)" required />
                    
                    <label for="eventVenuesID">Event Venues ID:</label>
                    <input type="number" id="eventVenuesID" name="eventVenuesID" value="" onchange="handleChange(event)" required />
                </div>
                <div class="form-group-inline">
                    <label for="ordersID">Orders ID:</label>
                    <input type="number" id="ordersID" name="ordersID" value="" onchange="handleChange(event)" required />
                    
                    <label for="sellerID">Seller ID:</label>
                    <input type="number" id="sellerID" name="sellerID" value="" onchange="handleChange(event)" required />
                </div>
                <div class="form-group-inline">
                    <label for="imageUrl">Image URL:</label>
                    <input type="text" id="imageUrl" name="imageUrl" value="" onchange="handleChange(event)" required />
                    
                    <label for="status">Status:</label>
                    <input type="text" id="status" name="status" value="" onchange="handleChange(event)" required />
                </div>
                <div class="form-group-inline">
                    <label for="type">Type:</label>
                    <input type="text" id="type" name="type" value="" onchange="handleChange(event)" required />
                    
                    <label for="validatedOn">Validated On:</label>
                    <input type="text" id="validatedOn" name="validatedOn" value="" onchange="handleChange(event)" />
                </div>
                <div class="form-group">
                    <label for="comment">Comment:</label>
                    <input type="text" id="comment" name="comment" value="" onchange="handleChange(event)" style="width: 60px;"/>
                </div>
                <div class="button">
                    <button type="submit">Create Item</button>
                </div>
            </form>
        </div>
    </div>
          <div className="button">
          <button type="submit">Create Item</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default ItemForm;
